import React, { useState, useEffect } from 'react'
import "/home/dinashboul/React_contextApi/myapp/src/componenets/Users/usr.css"
import axios from 'axios';
import Model from './Model';
import { useAuth } from '../../contexts/AuthContext';
import { useLogin } from '../../contexts/LoginContext';
import { Row ,Col} from 'react-bootstrap';
const UserCart = () => {

  const {dataContext}=useLogin()

  console.log("the data context is",dataContext)

  // console.log("the email of user is ",email)
  const [isUpdate, setIsUpdate] = useState(false)
  const [dataUser, setdataUser] = useState({})
  const apiUrl= `https://store-wbly.onrender.com/userbyemail/${dataContext.email}`
// const apiId=`https://store-wbly.onrender.com/user/${user_id}`
const {user}=useAuth()


useEffect(() => {
    const fetchData = async () => {

      await axios.get(apiUrl)
        .then((response) => {
          console.log("the status is ", response.status)
          console.log("response is ", response.data)
          setdataUser(response.data)
        }

        )
        .catch((err) =>
          console.log("No data Fetching", err)
        )};
         fetchData()
  }, []);

  console.log("the image is ->>", dataUser.image_url)

  //  update pic ////////////////////////////////////////////////////////////////////////////////////
  const imgCard =dataUser.image_url;
  const [image_url, setImageUrl] = useState(imgCard);

  const update = async (e) => {
    e.preventDefault()

    const configuration = {
      method: "Put",
      url: "https://store-wbly.onrender.com/user/" + dataUser.user_id,
      data: {
        image_url
      }

    }
    await axios(configuration)
      .then((result) => {
        console.log("the Update of image success", result.data)
        setIsUpdate(true)
      })
      .catch((err) => {
        err = new Error()
        console.log("no data")
      })
  }
  const [isModalOpen, setIsModalOpen] = useState(false);

  const openModal = () => {
    setIsModalOpen(true);
    console.log("opened")
  };

  const closeModal = () => {
    setIsModalOpen(false);
  };


  return (<>
  {user?(<>
    <div classNameName="image-area">
      <div classNameName="img-wrapper" key={dataUser.user_id}>
        <img
          src={dataUser.image_url} alt='' />
        <h2>{dataUser.full_name}</h2>
        <ul><li>
          <a
            href='#'
            onClick={openModal}
            style={{color:'white',fontSize:"1rem"}}
          >Edit</a>
          </li></ul>

        <Model isOpen={isModalOpen} onRequestClose={closeModal}
            image_url1={image_url}
            setImageUrl1={setImageUrl}
            update={update}
            isUpdate={isUpdate}
          />
      </div>
    </div>
{/* // ////////////////////// Favorite item /////////////////////////// */}

  <div className="main" >
  <Row>
  {dataUser.favorite && dataUser.favorite.map((item)=>
  <Col key={index} md={4}>
 <ul className="cards" key={item.item_id}>
   <li className="cards_item">
     <div className="card">
       <div className="card_image">
         <img src={item.image_url} alt="mixed vegetable salad in a mason jar." />
         <span className="card_price"><span>$</span>{item.price}</span>
       </div>
       <div className="card_content">
         <h2 className="card_title">{item.name}</h2>
         <div className="card_text">
           <p>{item.description}
           </p>
           <hr />
           <p>Served with your choice of dressing on the side: <strong>housemade ranch</strong>, <strong>cherry balsamic
               vinaigrette</strong>, <strong>creamy chipotle</strong>, <strong>avocado green goddess</strong>, or <strong>honey mustard</strong>. Add your choice
             of protein for $2 more.
           </p>
         </div>
       </div>
     </div>
   </li>
</ul>
</Col>)}
</Row>
</div>

</>

    ):( <p>Please log in to access the profile page.</p>)}
  </>
  )

}

export default UserCart
